const ProductDetail = (props) => {
    const keys = [];
    for (const key in props.product[0]) {
        keys.push(key)
    }
    return <div>
        {keys.map((item, i) => {
            return typeof (props.product[0][item]) === 'Object' ?
                <li> {props.product[0][item].map(el => el)}</li>
                :
                <li> {props.product[0][item]}</li>
        })}
    </div>
}

export default ProductDetail
